function getRefreshCount() {
	var regex = new RegExp('[\?&]refreshcount=([^&#]*)');
	var rs = regex.exec(location.search);
	return (rs == null || isNaN(Number(rs[1]))) ? 0 : Number(rs[1]);
}
function refreshIfNecessary(refreshUri, tokenExpiry) {
	if (window.refreshIfTokenExpired) {
		if (tokenExpiry.getTime() - new Date().getTime() < 300000 && refreshUri) {
			window.location.replace(refreshUri + "&refreshcount=" + (getRefreshCount() + 1));
		}
	}
}
function initializeWac() {
	window.wopiDiagClient.bootJsEndTime = new Date().getTime();
	var wacInitializer = new WacInitializer(window.appName, window.bootstrapperUrl, window._wopiContextJson);
	window.wacInitializer = wacInitializer;
	try {
		refreshIfNecessary(window.refreshUri, window.wopiAuthInfo.AccessTokenExpiry);
		if (window.serverErr) {
			wacInitializer.fail(window.serverErr);
		} else {
			wacInitializer.start(window.wopiAuthInfo);
			var wopiAuthInfo = window.wopiAuthInfo;
			if (wopiAuthInfo && wopiAuthInfo.AccessToken) {
				wacInitializer.complete(window.wopiAuthInfo, window.wopiFileInfo);
			}
		}
	}
	catch (err) {
		wacInitializer.fail(err);
	}
}
